import React, { useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import Header from '../components/Header';
import {Actions} from '../actions';
import './ProductList.css';

const productList = [
  {
    id: 1,
    name: 'Full Red Guppy',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://www.petguide.com/wp-content/uploads/2013/11/swordtail-fish.jpg'
  },
  {
    id: 2,
    name: 'Black Dorsal',
    quantity: 15,
    price: 700,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://d3sroz1c0sf1tc.cloudfront.net/catalog/product/cache/41bbdb7f5b3dd2c89286590613e1dee0/h/a/half-black-guppy-300x300.jpg'
  },
  {
    id: 3,
    name: 'Tiger Guppy',
    quantity: 10,
    price: 500,
    description: 'A healthy and good looking ornamental fish worth the money.',
    imageUrl: 'https://i.pinimg.com/736x/47/cb/33/47cb33fcb6306d204863c75cdd85e669.jpg'
  },
  {
    id: 4,
    name: 'Dream Catcher',
    quantity: 1,
    price: 500,
    description: '',
    imageUrl: 'https://www.aquastore.in/image/cache/catalog/aquastore.in/1.Storeimages/1.Aquarium/1.Aquastore/1.Guppy/83.yellow%20taxi/Yellow-Taxi-Guppy-Fish-600x600.jpg'
  },
  {
    id: 5,
    name: 'Koi Tuxedo',
    quantity: 1,
    price: 500,
    description: '',
    imageUrl: 'https://i.ytimg.com/vi/RfRtAVxRL4Q/maxresdefault.jpg'
  },
  {
    id: 6,
    name: 'Lady Tail',
    quantity: 1,
    price: 500,
    description: '',
    imageUrl: 'https://i.pinimg.com/originals/9d/e4/fe/9de4fecd1d0fd745ca30ee76f5ccd40f.jpg'
  },
  {
    id:7,
    name: 'Blue Mosco',
    quantity: 1,
    price: 500,
    description: '',
    imageUrl: 'https://i.pinimg.com/originals/f2/35/2e/f2352e9325de582dec1cf4bff1e010e8.jpg'
  },
  {
    id: 8,
    name: 'Yellow Tail',
    quantity: 1,
    price: 500,
    description: '',
    imageUrl: 'https://guppyexpert.com/wp-content/uploads/leopard-guppy.jpg'
  }
];
const ProductList = () => {
  const dispatch = useDispatch();
  const produc = useSelector(state => state.list.list);
  useEffect(()=>{
    console.log("started");
    dispatch(Actions.list());
  },[])
    return (
      <div className="main-container">
      {/* Header */}
      <Header/>
      <div className="container-fluid sub-container">
      <a href="#" className="btn btn-primary add-new" style={{float: "right"}} >Add New</a>
      {/* List of products */}
      <div className="row container-fluid">
      {
        productList.map((prod, index)=>{
          return(
            <div key={index} className="card" >
              <img src={prod.imageUrl} className="card-img-top thumbnail" />
              <div className="card-body">
                <div className="row card-title-container"> 
                <h5 className="card-title col-7">{prod.name}</h5>
                <h6 className="card-text col-5 price">Rs.{prod.price}</h6>
                  </div>
                <p className="card-text">{prod.description}</p>
                <p className="card-text">Only {prod.quantity} left.</p>
                <div className="col">
                <a href="#" className="btn btn-primary button col-5" >Edit</a>
                <a href="#" className="btn btn-danger col-5" style={{float: "right"}}>Delete</a>
                </div>
              </div>
            </div>
          )
        })
      }
      </div>
      </div>
      </div>

    );
};


export default ProductList;
